use jhonaite;


create TABLE IF NOT EXISTS taco (
    `Descricao_dos_alimentos` VARCHAR(64) CHARACTER SET utf8,
    `id` INT,
    `Umidade` VARCHAR(19) CHARACTER SET utf8,
    `Energia` VARCHAR(18) CHARACTER SET utf8,
    `Proteina` VARCHAR(19) CHARACTER SET utf8,
    `Carboidrato` VARCHAR(21) CHARACTER SET utf8,
    `Fibra` VARCHAR(19) CHARACTER SET utf8,
    `Sodio` VARCHAR(18) CHARACTER SET utf8);


CREATE TABLE IF NOT EXISTS `jhonaite`.`SISTEM_DB_J2` (
  `ID_SISTEM_DB_J2` INT NOT NULL,
  `USER_CPF` INT NOT NULL,
  PRIMARY KEY (`ID_SISTEM_DB_J2`, `USER_CPF`))
ENGINE = InnoDB;


CREATE TABLE IF NOT EXISTS `jhonaite`.`USER_DB-J1` (
  `NUM_CPF_USER` INT NOT NULL,
  `NAME_USER` VARCHAR(45) NOT NULL,
  `DATA_NASC` INT NOT NULL,
  `EMAIL_USER` VARCHAR(45) NOT NULL,
  `SISTEM_DB_J2_ID_SISTEM_DB_J2` INT NOT NULL,
  `SISTEM_DB_J2_USER_CPF` INT NOT NULL,
  PRIMARY KEY (`NUM_CPF_USER`, `SISTEM_DB_J2_ID_SISTEM_DB_J2`, `SISTEM_DB_J2_USER_CPF`),
  INDEX `fk_USER_DB-J1_SISTEM_DB_J21_idx` (`SISTEM_DB_J2_ID_SISTEM_DB_J2` ASC, `SISTEM_DB_J2_USER_CPF` ASC),
  CONSTRAINT `fk_USER_DB-J1_SISTEM_DB_J21`
    FOREIGN KEY (`SISTEM_DB_J2_ID_SISTEM_DB_J2` , `SISTEM_DB_J2_USER_CPF`)
    REFERENCES `mydb`.`SISTEM_DB_J2` (`ID_SISTEM_DB_J2` , `USER_CPF`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;



CREATE TABLE IF NOT EXISTS `jhonaite`.`INFO_ALIMENT_DB_J3` (
  `ID_INFO_ALIMENT` INT NOT NULL,
  `CARBO` VARCHAR(30) NOT NULL,
  `PROT` VARCHAR(30) NOT NULL,
  `CALORI` VARCHAR(30) NOT NULL,
  `Sistema_idSistema` INT NOT NULL,
  `Sistema_Usuário_CPF` INT NOT NULL,
  `SISTEM_DB_J2_ID_SISTEM_DB_J2` INT NOT NULL,
  `SISTEM_DB_J2_USER_CPF` INT NOT NULL,
  `TACODB3_J4_ID_TACODB3_J4` INT NOT NULL,
  PRIMARY KEY (`ID_INFO_ALIMENT`, `Sistema_idSistema`, `Sistema_Usuário_CPF`, `SISTEM_DB_J2_ID_SISTEM_DB_J2`, `SISTEM_DB_J2_USER_CPF`, `TACODB3_J4_ID_TACODB3_J4`),
  INDEX `fk_INFO_ALIMENT_DB_J3_SISTEM_DB_J21_idx` (`SISTEM_DB_J2_ID_SISTEM_DB_J2` ASC, `SISTEM_DB_J2_USER_CPF` ASC) ,
  INDEX `fk_INFO_ALIMENT_DB_J3_TACODB3_J41_idx` (`TACODB3_J4_ID_TACODB3_J4` ASC) ,
  CONSTRAINT `fk_INFO_ALIMENT_DB_J3_SISTEM_DB_J21`
    FOREIGN KEY (`SISTEM_DB_J2_ID_SISTEM_DB_J2` , `SISTEM_DB_J2_USER_CPF`)
    REFERENCES `mydb`.`SISTEM_DB_J2` (`ID_SISTEM_DB_J2` , `USER_CPF`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_INFO_ALIMENT_DB_J3_TACODB3_J41`
    FOREIGN KEY (`TACODB3_J4_ID_TACODB3_J4`)
    REFERENCES `mydb`.`TACODB3_J5` (`ID_TACODB3_J4`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;



